import { axiosGet } from "@/services/service";
const actions = {
  async triggerSetTask({ commit }, payload) {
    const result = await axiosGet(`showTask/?job_id=${payload.job_id}`);
    await commit("SET_TASK", { data: result.data });
  },
};
export default actions;
